(1, NULL, '2019-01-16 06:06:17', '2019-10-02 17:11:35', 'Welcome to DigiPrima!\r\n\r\nAs you navigate our website, I hope you learn more about the qualities that make our company an outstanding provider of essential government services and a wonderful place to build a career.\r\n\r\nWe provide service with a human touch.\r\n\r\nWe have earned the trust and respect of government customers for one simple reasonwe have great people. They are experts in their fields. They bring a strong service ethos to everything they do. They take pride and ownership in the jobs they do. We bring passion, pride and experience together.\r\n\r\nWe make a positive difference in peoples lives.\r\n\r\nAt Serco, we have earned a reputation for helping our government clients to transform the way in which citizens access government services. The programs we support are critical to keeping the nation secure, as well as making government services more efficient. From modernizing the Navy and supporting returning warriors to ensuring healthcare access and keeping the skies safe, Serco has earned a reputation for delivering on programs that truly make a difference.\r\n\r\nWe have a client first philosophy.\r\n\r\nWe have only one objective: to ensure our clients mission objectives are achieved with the highest level of capability and assurance, and at the lowest possible cost. Our methodology ensures that vital government programs are stood up on time and on schedule. Sercos clients come to us with confidence that we have the expertise to take service delivery to the next level of performance.\r\n\r\nWe have true international reach.\r\n\r\nWe have worked in many of the most demanding and secure environments in the world, and our global reach means that we can support our clients wherever their needs require. As part of Serco Group plc, we are able to draw upon the accumulated knowledge of an organization that has set new standards of excellence in sectors including transportation, healthcare, and defense. We apply the very best international insights to keep our clients at the leading edge.\r\n\r\nWe live out our values.\r\n\r\nSercos corporate culture is defined by a simple set of corporate values that define how we operate every single day  Trust, Care, Innovation, and Pride. They reflect how we interact with our clients, our colleagues, and our communities. We hold each other accountable for creating a company we can all be proud to work at.\r\n\r\nI hope this provides you with a few reasons to get to know Serco better. Whether you are a potential customer, a small business partner, or a future employee, we look forward to finding out how we can work together to bring service to life.', 'Digiprimas vision is to create smart and sustainable It solutions for wellbeing of society and growth of industries \r\n', 'Achieving 25% CAGR by providing smart solutions to Fintech, Healthcare and Manufacturing Industries.', '2', 'Customer Commitment\n\nQuality Delightment\n\nIntegrity at core\n\nTeamwork \n\nRespect for People and Process');
