INSERT INTO `faqs` (`id`, `deleted_at`, `created_at`, `updated_at`, `question`, `answer`, `company_id`) VALUES
(1, '2019-07-09 01:40:41', '2019-05-20 01:00:39', '2019-05-20 01:00:39', 'test question 1', 'test answare 1', ''),
(2, NULL, '2019-07-09 01:39:44', '2019-10-21 15:11:39', 'How to update these action plans and other information? Who will update these details?', 'These will be done by different&#160;people in the organization. The write access will be provided by the management (seniors) based on hierarchy and Admin or Super Admin can provide access. This will be a one type set up and can be done very quickly.<div><br></div><div>Basically, there 2 types of controls here. One is level and position (right now we have provided 4 levels, but we can add more if needed) and the second control us related to Function or department...all&#160;these can&#160;be set up easily.&#160;</div><div><br></div><div>Later on as a regular practice, these people will be responsible for entering the details. There can be fixed deadline for updating the date. Beyond this auto escalation&#160;can&#160; happen at decided frequency and to defined levels.&#160;</div><div><br></div>', '2'),
(3, NULL, '2019-07-09 01:40:33', '2019-10-21 15:04:37', 'What is the importance of Business Vital?', 'Business Vitals are important functional details which at times we need for discussion or reviews or making some decisions. Unfortunately, these information are not available when we actually&#160;need it. Or we need to chase or do follow up from other employees.<div><br></div><div>This menu in PrimaPlus will ensure all vital information is available on finger tips when needed.</div>', '2'),
(4, NULL, '2019-07-09 01:41:55', '2019-10-21 15:00:42', 'There are too many items in the menu, also the database seems to be too high? The question is, who will fill all this information? This looks to be a full time job for&#160;some one? Or need to a hire a person for this?', 'Not really. The database looks high and the content looks high if we see the overall available information from Super Admin perspective. Basically, each employee will be provided read and write access based on his role and position in the organization. A supervisor will have limited access, information related to his area only. A Vice President&#160;will have access&#160;to much larger information&#160;related to his function.<div>So depending on the role and position in the organization access and viewership will be provided.</div><div><br></div><div>All these people will be provided access through password and they will be able to enter data related to thier&#160;respective functions.</div><div>Pl refer Demo slides of Prima Plus in&#160; PrimaPlus Navigation Menu,</div><div><br></div>', '2'),
(5, '2019-09-29 10:39:00', '2019-07-11 09:29:50', '2019-08-02 06:50:45', 'hhhhhhhhhhhhhiiiiiiiiiiiiiiiii', '<font color="#121010">hhhiiii</font>', '2'),
(6, '2019-07-11 09:34:55', '2019-07-11 09:34:47', '2019-07-11 09:34:47', '<p>safsafsafsafsafsaf</p>', '<p>edesdfasfsafsafsa</p>', '2'),
(7, NULL, '2019-07-11 10:40:55', '2019-07-12 05:12:37', 'test', 'test', ''),
(8, '2019-07-11 01:16:22', '2019-07-11 10:43:19', '2019-07-11 13:15:15', '<font face="Calibri"><b>Test</b></font>', '<span><span>To add an international contact\'s phone number</span><span>:</span></span><span> Go to your phone\'s address book. When adding the contact\'s phone number, start by entering a plus sign (+). Enter the country code, followed by the full phone number. Note: A country code is a numerical prefix that needs to be entered before the full national phone number to make a call to another country. You can search online to find the country code you need.</span>', '2'),
(9, '2019-09-29 10:38:55', '2019-08-01 14:21:43', '2019-08-02 06:04:16', '<div><font color="#6a6a6a" face="Roboto, arial, sans-serif" size="4"><span><b>Test FAQ</b></span></font></div><div><span>who is thought to have scrambled parts of <b>Cicero\'s De Finibus Bonorum</b> et&#160;</span></div>', '<span>Lorem ipsum</span><span>, or&#160;</span><span><b>lipsum</b></span><span>&#160;as it is sometimes known, is dummy text used in laying out print, graphic or web designs. The passage is attributed to an unknown typesetter in the 15th&#160;</span><div><ol><li><span>century who is thought to have scrambled&#160;</span></li><li><span>parts of Cicero\'s De Finibus Bonorum et Malorum</span></li><li><span>&#160;for use in a type specimen book</span></li></ol></div>', '2'),
(10, NULL, '2019-09-02 06:45:11', '2019-09-29 10:38:38', 'There are different Menus, right from Strategic Objectives, Strategic Initiatives and Action plan, who will fill all these information?', 'It is simple, these will be done by different people at different levels based on the hierarchy set in the governance structure of the organization. Super admin will set the Read, Write and modify controls to these people based on management direction.', '2');
